import { BrowserRouter, Route, Switch } from 'react-router-dom';
import MapMarkers from './source/MapMarkers'
import communities from './source/communities'
import Reviews from './source/reviewTest'
import Menubar from './source/Menubar';
import ReadCommunity from './source/ReadCommunity'
import CreateReview from './source/CreateReview';
import ReadReview from './source/ReadReview'
import HappyChatbot from './source/Chatbot'
import axios from 'axios';
import {useState} from 'react'
import list from './Image/check.png'
import './App.css'

function App() {
    const [dibs_list, setDibs] = useState();
    
    const dibs = (dib) => (
        <li><img id = "listImage" alt="" src={list}/>{dib.danjiName}</li>
    );

    const loadDibsData = () => {
      console.log(1)
        var userId = localStorage.getItem("userID")
        axios.get(`https://joj5opq81m.execute-api.us-east-2.amazonaws.com/happyhouse/dibs/userid/${userId}`).then(({data}) => {
            data = data.dibs
            setDibs(data.map(dibs))
        })
    }
  return (
    <div className = "App">
      
      <div className = "header_container">
        <Menubar dibs_list = {dibs_list} loadDibsData={()=>{loadDibsData}}/>
      </div>

      <div className = "body_container">
        <BrowserRouter>
        <Switch>
          <Route exact path={"/"} component={MapMarkers} dibs_list = {dibs_list} loadDibsData = {()=>{loadDibsData}}/>
          <Route exact path={"/reviews"} component={Reviews} />
          <Route exact path={"/communities"} component={communities} />
          <Route exact path={"/communities/detail"} component={ReadCommunity} />
          <Route exact path={"/reviews/detail"} component={ReadReview} />
          <Route exact path={"/reviews/create"} component={CreateReview} />
        </Switch>
        </BrowserRouter>
        <HappyChatbot/>
      </div>
    </div>
  )
}

export default App;
